import React, { Component } from 'react';

class TOC extends Component {
  shouldComponentUpdate(updatedsProps, updatedState) {
    if(updatedProps === this.props) {
      console.log(" norender!");
      return false;
    }
    else {
      console.log("render!");
      return true;
    }
  }

  render() {
    var lists = [];
    var data = this.props.data;
    var i = 0;

    while (i < data.length) {
      lists.push(
        <li key={data[i].id}>
          <a
            href={"/content/" + data[i].id}
            data-id={data[i].id}
            onClick={function (e) {
              e.preventDefault();
              this.props.onChangePage(e.target.dataset.id);
            }.bind(this)}>
            {data[i].title}</a>
        </li>)

      i = i + 1;
    }
    return (
      <nav>
        <ul>
          {lists}
        </ul>
      </nav>
    );
  }
}

export default TOC;
